import styled from 'styled-components';

export const LoanContainerWrap = styled.div`
  margin: 2em;
  border: 1px solid #ccc;
  border-radius: 10px;
  width: 100%;
  .react-tabs__tab-list {
    display: flex;
    border-bottom: 1px solid #ccc;
    .react-tabs__tab {
      padding: 10px 15px;
      border-right: 1px solid #ccc;
    }
  }
`;
